import React, { useState } from 'react';
import { Container,Table} from 'react-bootstrap';
import { useSelector } from 'react-redux';

function Cart() {
    const list = useSelector((state) => state.cart.product)
  
    return (
    <div> 
    
       
        <Container className='text-center ms-2 '><h1>CARTPAGE</h1></Container>
         {list.map( item =>
         <Container className='cartnum'>
              <Table striped bordered hover>
      <thead>
        <tr>
         <th>#</th>
          <th>Product</th>
          <th>Quantity</th>
          <th>Price</th>
          <th>Total</th>
        </tr>
      </thead>
      <tbody>
        <tr>
            <td>1</td>
          <td><img src={item.image}></img> {item.name}</td>
          <td>1</td>
          <td>{item.price}</td>
          <td>100</td>
        </tr>
      </tbody>
    </Table>
        
        </Container>)
       
}
   
    </div>
      );
}

export default Cart;
